INSERT INTO `book` (`b_id`, `b_name`, `b_author`, `b_publisher`, `b_category`, `b_description`, `b_image`) VALUES
(1, 'Harry Potter and the Philosopher\'s Stone', 'J. K. Rowling', 'Bloomsbury (UK) ', 'Fantasy', 'Harry Potter, a young wizard who discovers his magical heritage on his eleventh birthday, when he receives a letter of acceptance to Hogwarts School of Witchcraft and Wizardry. Harry makes close friends and a few enemies during his first year at the school, and with the help of his friends, Harry faces an attempted comeback by the dark wizard Lord Voldemort, who killed Harry\'s parents, but failed to kill Harry when he was just 15 months old.', );
INSERT INTO `book` (`b_id`, `b_name`, `b_author`, `b_publisher`, `b_category`, `b_description`, `b_image`) VALUES
(2, 'Harry Potter and the Chamber of Secrets', 'J. K. Rowling', 'Bloomsbury (UK) ', 'Fantasy', 'Harry\'s second year at Hogwarts School of Witchcraft and Wizardry, during which a series of messages on the walls of the school\'s corridors warn that the \"Chamber of Secrets\" has been opened and that the \"heir of Slytherin\" would kill all pupils who do not come from all-magical families. These threats are found after attacks that leave residents of the school petrified. Throughout the year, Harry and his friends Ron and Hermione investigate the attacks.', );
INSERT INTO `book` (`b_id`, `b_name`, `b_author`, `b_publisher`, `b_category`, `b_description`, `b_image`) VALUES
(6, 'Diary Of A Wimpy Kid: Dog Days', 'Jeff Kinney', 'Harry N. Abrams, Inc.', 'Comedy', 'It\'s summer vacation, the weather\'s great, and all the kids are having fun outside. So where\'s Greg Heffley? Inside his house, playing video games with the shades drawn.\r\n\r\nGreg, a self-confessed \"indoor person,\" is living out his ultimate summer fantasy: no responsibilities and no rules. But Greg\'s mom has a different vision for an ideal summer . . . one packed with outdoor activities and \"family togetherness.', );
INSERT INTO `book` (`b_id`, `b_name`, `b_author`, `b_publisher`, `b_category`, `b_description`, `b_image`) VALUES
(7, 'The Sea of Monsters', 'Rick Riordan', 'Miramax Books', 'Adventure', 'The heroic son of Poseidon makes an action-packed comeback in the second must-read installment of Rick Riordan\'s amazing young readers series. Starring Percy Jackson, a \"half blood\" whose mother is human and whose father is the God of the Sea, Riordan\'s series combines cliffhanger adventure and Greek mythology lessons that results in true page-turners that get better with each installment.\r\n\r\nIn this episode, The Sea of Monsters, Percy sets out to retrieve the Golden Fleece before his summer camp is destroyed, surpassing the first book\'s drama and setting the stage for more thrills to come.', );
INSERT INTO `book` (`b_id`, `b_name`, `b_author`, `b_publisher`, `b_category`, `b_description`, `b_image`) VALUES
(9, 'Percy Jackson and the Last Olympian', 'Rick Riordan', 'Miramax Books', 'Adventure', 'The Last Olympian is a fantasy-adventure novel based on Greek mythology by Rick Riordan, published on May 5, 2009.[3] It is the fifth and final novel of the Percy Jackson & the Olympians series and serves as the direct sequel to The Battle of the Labyrinth.[3] The Last Olympian revolves around the demigod Percy Jackson as he leads his friends in the last stand to protect Mount Olympus.', );
INSERT INTO `book` (`b_id`, `b_name`, `b_author`, `b_publisher`, `b_category`, `b_description`, `b_image`) VALUES
(10, 'Diary of a Wimpy Kid: The Long Haul', 'Jeff Kinney', 'Harry N. Abrams, Inc.', 'Comedy', 'The journey starts off full of promise, then quickly takes several wrong turns. Gas station bathrooms, crazed seagulls, a fender bender, and a runaway pig?not exactly Greg Heffleys idea of a good time. But even the worst road trip can turn into an adventure?and this is one the Heffleys wont soon forget.', );
INSERT INTO `book` (`b_id`, `b_name`, `b_author`, `b_publisher`, `b_category`, `b_description`, `b_image`) VALUES
(11, 'Diary of a Wimpy Kid: Rodrick Rules', 'Jeff Kinney', 'Harry N. Abrams, Inc.', 'Comedy', 'Whatever you do, dont ask Greg Heffley how he spent his summer vacation, because he definitely doesnt want to talk about it.\r\nAs Greg enters the new school year, hes eager to put the past three months behind him and one event in particular.\r\nUnfortunately for Greg, his older brother, Rodrick, knows all about the incident Greg wants to keep under wraps. But secrets have a way of getting out especially when a diary is involved.\r\nDiary of a Wimpy Kid Rodrick Rules chronicles Gregs attempts to navigate the hazards of middle school, impress the girls, steer clear of the school talent show, and most important, keep his secret safe.', );
INSERT INTO `book` (`b_id`, `b_name`, `b_author`, `b_publisher`, `b_category`, `b_description`, `b_image`) VALUES
(12, 'The Battle of the Labyrinth', 'Rick Riordan', 'Miramax Books', 'Adventure', 'Percy Jackson isnt expecting freshman orientation to be any fun, but when a mysterious mortal acquaintance appears, pursued by demon cheerleaders, things quickly go from bad to worse.\r\nTime is running out for Percy. War between the gods and the Titans is drawing near. Even Camp Half-Blood isnt safe, as Kronos? army prepares to invade its once impenetrable borders. To stop them, Percy and his friends must set out on a quest through the Labyrinth a sprawling underground world with surprises and danger at every turn.\r\nAlong the way Percy will confront powerful enemies, find out the truth about the lost god Pan, and face the Titan lord Kronos? most terrible secret. The final war begins with the Battle of the Labyrinth.', );
INSERT INTO `book` (`b_id`, `b_name`, `b_author`, `b_publisher`, `b_category`, `b_description`, `b_image`) VALUES
(13, 'A History of Sri Lanka', 'K. M. de Silva', 'University of California Press', 'History', 'Synopsis This book presents the history of Sri Lanka from the earliest times to the present. Sri Lanka is an ancient civilization, shaped and thrust into the modern globalizing world by its colonial experience. With its own unique problems, many of them historical legacies, it is a nation trying to maintain a democratic, pluralistic state structure while struggling to come to terms with separatist aspirations. This is a complex story, and there is perhaps no better person to present it in reasoned, scholarly terms than K. M. de Silva, Sri Lankas most distinguished and prolific historian.', );
INSERT INTO `book` (`b_id`, `b_name`, `b_author`, `b_publisher`, `b_category`, `b_description`, `b_image`) VALUES
(14, 'Basic Physics: A Self-Teaching Guide', 'Karl F. Kuhn', 'Unknown', 'Science', 'Here is the most practical, complete, and easy-to-use guide available for understanding physics and the physical world. Even if you dont consider yourself a science person, this book helps make learning key concepts a pleasure, not a chore. Whether you need help in a course, want to review the basics for an exam, or simply have always been curious about such physical phenomena as energy, sound, electricity, light, and color, youve come to the right place This fully up-to-date edition of Basic Physics.', );
INSERT INTO `book` (`b_id`, `b_name`, `b_author`, `b_publisher`, `b_category`, `b_description`, `b_image`) VALUES
(15, 'C++ Primer', 'Josee Lajoie and Stanley B. Lippman', 'Addison-Wesley', 'IT', 'If you are new to C++ programming, C++ Primer Plus, Fifth Edition is a friendly and easy-to-use self-study guide. You will cover the latest and most useful language enhancements, the Standard Template Library and ways to streamline object-oriented programming with C++. This guide also illustrates how to handle input and output, make programs perform repetitive tasks, manipulate data, hide information, use functions and build flexible, easily modifiable programs. C++ Primer Plus, Fifth Edition makes learning and using important object-oriented programming concepts understandable. Choose this classic to learn the fundamentals and more of C++ programming Resource description page.', );

